import React from 'react';
const getMobileNumber=(text)=>{
    const mobile =(text.match(/([+]?\d{1,2}?)?(\d{3}?){2}\d{5}/g,''))
    return(
      {mobile}
    )
  }
  export default getMobileNumber;
